/*
LeetCode 954. Array of Doubled Pairs
https://leetcode.com/problems/array-of-doubled-pairs/
Input 1: [3,1,3,6]
Output 1: false

Input 2: [2,1,2,6]
Output 2: false

Input 3: [4,-2,2,-4]
Output 3: true
Explanation: We can take two groups, [-2,-4] and [2,4] to form [-2,-4,2,4] or [2,4,-2,-4].

Input 4: [1,2,4,16,8,4]
Output 4: false
*/
#include <bits/stdc++.h>

using namespace std;

bool canReorderDoubled(vector<int>& A) {
	map<int, int> Amap;

	for (auto a : A)
		Amap[a < 0 ? -a : a] ++;

	for (auto am : Amap)
	{
		int key = am.first;
		int key2 = key * 2;
		Amap[key2] -= am.second;
		if (Amap[key2] < 0)
			return false;
	}

	return true;
}

void check(int nums[], int size, bool expected) {
	vector<int> v(nums, nums + size);
	bool actual = canReorderDoubled(v);
	cout << boolalpha;
	cout << (actual == expected ? "PASS" : "FAIL") << " "
		<< " ( " << expected << " / " << actual << ")" << endl;
}

